import React from "react";
import { Box, Image } from "@chakra-ui/core";

const CheckIn = () => {
  return (
    <Box
      backgroundImage="url(/assets/images/check-in.png)"
      backgroundSize="contain"
      width="auto"
      height="100vh"
    >
      <Box color="white">hello</Box>
    </Box>
  );
};

export default CheckIn;
